-- ----------------------------
-- View structure for `v_max`
-- ----------------------------
DROP VIEW IF EXISTS `v_max`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_max` AS select max(`tbl_update`.`update_id`) AS `max_update`,`tbl_update`.`monitoring_id` AS `monitoring_id`,`tbl_monitoring`.`do_no` AS `do_no`,`tbl_monitoring`.`customer_id` AS `customer_id` from (`tbl_update` join `tbl_monitoring` on((`tbl_monitoring`.`monitoring_id` = `tbl_update`.`monitoring_id`))) group by `tbl_update`.`monitoring_id` ;

-- ----------------------------
-- View structure for `v_max_update_max_position`
-- ----------------------------
DROP VIEW IF EXISTS `v_max_update_max_position`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_max_update_max_position` AS select `v_max`.`max_update` AS `max_update`,`v_max`.`monitoring_id` AS `monitoring_id`,`v_max`.`do_no` AS `do_no`,`v_max`.`customer_id` AS `customer_id`,`tbl_update`.`position` AS `position`,`tbl_update`.`status` AS `status` from (`v_max` join `tbl_update` on((`v_max`.`max_update` = `tbl_update`.`update_id`))) where (`tbl_update`.`status` <> 'CLOSE') ;

-- ----------------------------
-- View structure for `v_sum_tonnage_per_day`
-- ----------------------------
DROP VIEW IF EXISTS `v_sum_tonnage_per_day`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_sum_tonnage_per_day` AS select `tbl_monitoring`.`customer_id` AS `customer_id`,`tbl_monitoring`.`commodity_id` AS `commodity_id`,`tbl_monitoring`.`uom_id` AS `uom_id`,sum(`tbl_monitoring`.`tonnage`) AS `sum_tonnage`,date_format(`tbl_monitoring`.`departure`,'%Y-%m-%d') AS `departure`,extract(day from `tbl_monitoring`.`departure`) AS `day_dept`,extract(month from `tbl_monitoring`.`departure`) AS `month_dept`,extract(year from `tbl_monitoring`.`departure`) AS `year_dept` from `tbl_monitoring` group by `tbl_monitoring`.`commodity_id`,`tbl_monitoring`.`customer_id`,date_format(`tbl_monitoring`.`departure`,'%Y-%m-%d'),`day_dept`,`month_dept`,`year_dept` ;

