-- Procedure structure for `pReport`
-- ----------------------------
DROP PROCEDURE IF EXISTS `pReport`;
DELIMITER ;;
CREATE DEFINER=`monitoring_user`@`%` PROCEDURE `pReport`(startdate timestamp, enddate timestamp)
pReport:BEGIN
	#Routine body goes here...
   -- declare startdate timestamp;
   -- declare enddate timestamp;
   declare unitval VARCHAR(10);
   declare intval  INTEGER;

   declare thisDate timestamp;
   declare nextDate timestamp;

	-- Declare variable untuk di loop
  DECLARE var_finished INTEGER DEFAULT 0;
  DECLARE var_customer_id INTEGER DEFAULT 0;
  DECLARE var_customer_id_old INTEGER DEFAULT 0;
  DECLARE var_commodity_id INTEGER DEFAULT 0;
  DECLARE var_uom_id INTEGER DEFAULT 0;
  DECLARE var_sum_tonnage INTEGER DEFAULT 0;
  DECLARE var_departure DATE;

  -- declare cursor for v_sum_tonnage_per_day berdasarkan range tanggal
  DEClARE sum_ton_cursor CURSOR FOR 
		SELECT a.customer_id, a.commodity_id, a.uom_id, a.sum_tonnage, a.departure
		FROM v_sum_tonnage_per_day a
		WHERE (a.departure >= startdate AND a.departure <= enddate);


  -- declare NOT FOUND handler
  DECLARE CONTINUE HANDLER 
      FOR NOT FOUND SET var_finished = 1;

  DROP TEMPORARY TABLE IF EXISTS tempEstTable;
  CREATE TEMPORARY TABLE IF NOT EXISTS tempEstTable 
    (customer_id INT, commodity_id INT, uom_id INT, departure DATE, sum_tonnage NUMERIC(18,2));


   -- set startdate = '2016-01-25 00:00:00';
   -- set enddate = '2016-02-05 00:00:00';
   set unitval  = 'DAY';
   set intval  = '1';

   set thisDate = startdate;

   -- *************************************************************************
   -- Drop / create the temp table
   -- *************************************************************************
   drop temporary table if exists time_intervals;
   create temporary table if not exists time_intervals
      (
      interval_start timestamp,
      interval_end timestamp
      );

   -- *************************************************************************
   -- Loop through the startdate adding each intval interval until enddate
   -- *************************************************************************
   repeat
      select
         case unitval
            when 'MICROSECOND' then timestampadd(MICROSECOND, intval, thisDate)
            when 'SECOND'      then timestampadd(SECOND, intval, thisDate)
            when 'MINUTE'      then timestampadd(MINUTE, intval, thisDate)
            when 'HOUR'        then timestampadd(HOUR, intval, thisDate)
            when 'DAY'         then timestampadd(DAY, intval, thisDate)
            when 'WEEK'        then timestampadd(WEEK, intval, thisDate)
            when 'MONTH'       then timestampadd(MONTH, intval, thisDate)
            when 'QUARTER'     then timestampadd(QUARTER, intval, thisDate)
            when 'YEAR'        then timestampadd(YEAR, intval, thisDate)
         end into nextDate;

      set thisDate = nextDate;
   -- until thisDate >= enddate
   until enddate = timestampadd(DAY, -1, nextDate)
   end repeat;

	-- call make_intervals('2009-01-01 00:00:00','2009-01-10 00:00:00',1,'DAY');
	-- SELECT interval_start FROM time_intervals;
	
	-- Looping v_sum_tonnage_per_day berdasarkan range waktu yang dipilih
	SET var_customer_id_old = 0;

  OPEN sum_ton_cursor;

  get_sum_ton: LOOP


      IF var_finished = 1 THEN 
          LEAVE get_sum_ton;
      END IF;

      FETCH sum_ton_cursor INTO var_customer_id, var_commodity_id, var_uom_id, var_sum_tonnage, var_departure;

			SELECT var_customer_id, var_commodity_id, var_uom_id, var_sum_tonnage, var_departure;
			-- SELECT var_customer_id, var_commodity_id, var_sum_tonnage, var_departure;
			
			IF (var_customer_id_old = var_customer_id) THEN
				SELECT var_customer_id, var_commodity_id, var_uom_id, 0, interval_start 
				FROM time_intervals 
				WHERE interval_start NOT IN 
				(
					SELECT a.departure
					FROM v_sum_tonnage_per_day a
					WHERE (a.departure >= startdate AND a.departure <= enddate) AND customer_id = var_customer_id
				);					
			END IF;
			
			SET var_customer_id_old = var_customer_id;
			
  END LOOP get_sum_ton;

  CLOSE sum_ton_cursor;

	-- SELECT * FROM tempEstTable ORDER BY customer_id, commodity_id, departure;

	-- LEAVE pReport;


	set session group_concat_max_len = 1024000;

	SET @sql = NULL;
	SELECT
		GROUP_CONCAT(DISTINCT
			CONCAT(
						'SUM(IF((`departure` = "', `departure`, '"),sum_tonnage,0)) AS "',LEFT(f_date_ke_tanggal(`departure`,1),10),'"')
			ORDER BY departure) INTO @sql
	FROM tempEstTable;

	-- SELECT @sql;

	-- LEAVE pReport;

	SET @sql = CONCAT('SELECT  
													(SELECT customer FROM tbl_customer WHERE tbl_customer.customer_id = tempEstTable.customer_id) AS Customer, 
													(SELECT commodity FROM tbl_commodity WHERE tbl_commodity.commodity_id = tempEstTable.commodity_id) AS Commodity, 
													(SELECT uom FROM tbl_uom WHERE tbl_uom.uom_id = tempEstTable.uom_id) AS UoM,', 
													@sql, ', SUM(sum_tonnage) AS Total
										FROM    tempEstTable
										GROUP BY customer_id, commodity_id, uom_id
										');

	PREPARE stmt FROM @sql;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

END
;;
DELIMITER ;

