						'FORMAT(SUM(IF((`departure` = "', `departure`, '"),sum_tonnage,0)),2) AS "',LEFT(f_date_ke_tanggal(`departure`,1),10),'"')
			ORDER BY departure) INTO @sql
	FROM tempEstTable;

	-- SELECT @sql;

	-- LEAVE pReport;

	SET @sql = CONCAT('SELECT  
													-- (SELECT customer FROM tbl_customer WHERE tbl_customer.customer_id = tempEstTable.customer_id) AS Customer, 
													(SELECT commodity FROM tbl_commodity WHERE tbl_commodity.commodity_id = tempEstTable.commodity_id) AS Commodity, 
													(SELECT uom FROM tbl_uom WHERE tbl_uom.uom_id = tempEstTable.uom_id) AS UoM,', 
													@sql, ', FORMAT(SUM(sum_tonnage),2) AS Total
										FROM    tempEstTable
										GROUP BY customer_id, commodity_id, uom_id
										');

	PREPARE stmt FROM @sql;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `f_date_ke_tanggal`
-- ----------------------------
DROP FUNCTION IF EXISTS `f_date_ke_tanggal`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `f_date_ke_tanggal`(tanggal VARCHAR(25), mode INT) RETURNS varchar(255) CHARSET utf8
BEGIN
/*DECLARE VALUES YOU MAY NEED, EXAMPLE:
  DECLARE NOM_VAR1 DATATYPE [DEFAULT] VALUE;
  */
  DECLARE hasil VARCHAR(50) DEFAULT "";
  DECLARE tgl VARCHAR(2) DEFAULT "";
  DECLARE bln VARCHAR(2) DEFAULT "";
  DECLARE bln2 VARCHAR(3) DEFAULT "";
  DECLARE bln3 VARCHAR(20) DEFAULT "";
  DECLARE thn VARCHAR(4) DEFAULT "";
  DECLARE jam VARCHAR(8) DEFAULT "";

  SET tgl = mid(tanggal,9,2);
  SET bln = mid(tanggal,6,2);
  SET bln2 = LEFT((SELECT bulan FROM bulan WHERE id=bln),3);
  SET bln3 = (SELECT RTRIM(bulan) FROM bulan WHERE id=bln);
  SET thn = left(tanggal,4);
  
  IF mode = 1 THEN
    SET hasil = concat(tgl,'/',bln,'/',thn);
  ELSEIF mode = 2 THEN
    SET hasil = concat(tgl,'-',bln2,'-',thn);
  ELSEIF mode = 3 THEN
    SET hasil = concat(tgl,' ',bln3,' ',thn);
  END IF;
	
	SET jam = mid(tanggal,12,8);

  RETURN concat(hasil,' / ',jam);
  
END
;;
DELIMITER ;
